import './admin.css';
import React, { useState } from "react";
import { Link } from "react-router-dom";
import Modal from "react-modal";

function Admin({ onLogout }) {
  const [isModalVisible, setIsModalVisible] = useState(false);

  const showModal = () => setIsModalVisible(true);
  const hideModal = () => setIsModalVisible(false);
  const handleLogout = () => {
    onLogout();
    hideModal();
  };

  return (
    <div className="Web">
      <div className="footer-bar"></div>

      <div className="admin-container">
        <h1 className="admin-title">Admin</h1>
        <div className="admin-options">
          <Link to="/clientes" className="admin-option">
            <img src="/icon-clientes.svg" alt="Clientes Icone" className="icon" />
            <span>Clientes</span>
          </Link>
          <Link to="/passeadores" className="admin-option">
            <img src="/icon-passeadores.svg" alt="Passeadores Icone" className="icon" />
            <span>Cardapio</span>
          </Link>
          <Link to="" className="admin-option">
            <img src="/icon-backups.svg" alt="Backups Icone" className="icon" />
            <span>Backups</span>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Admin;
